import React from 'react';
import './style.css';


export const SideBar = () =>{
	return(
		<div className="container">
			<ul>
            <li><Link to='/'>Stories</Link></li>
            <li><Link to='/produtos'>Bright</Link></li>
          </ul>
		</div>
	);
}
